import * as React from 'react';
import { View, StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  paddingBot: 
  {
    paddingBottom: '2%'
  },
  paddingTop: 
  {
    paddingTop: '2%'
  },
  mainStyle: 
  {
    backgroundColor: 'gray',
    height: 0.5,
    // width: props.width,
    marginTop: 10,
  }
})

function Divider(props)
{
  var padding = (props.useBottomPadding ? styles.paddingBot : styles.paddingTop)

  return(
    <View
      style={[ styles.mainStyle, padding, { width: props.width } ]}
    />
  )
}

export { Divider };
